        body {
            font-family: 'Roboto', sans-serif;
            margin: 0;
            padding: 0;
            box-sizing: border-box;
            color: #333;
        }

        /* Navigation styling */
        nav {
            background-color: #333;
            padding: 1em;
            position: sticky;
            top: 0;
            z-index: 1000;
        }

        nav ul {
            list-style-type: none;
            margin: 0;
            padding: 0;
            display: flex;
            justify-content: center;
        }

        nav ul li {
            margin: 0 1em;
        }

        nav ul li a {
            color: white;
            text-decoration: none;
            font-size: 1.1em;
            font-weight: 700;
        }

        nav ul li a:hover {
            text-decoration: underline;
        }

        /* Mobile navigation dropdown */
        .nav-toggle {
            display: none;
            font-size: 1.5em;
            color: white;
            background-color: transparent;
            border: none;
            cursor: pointer;
            position: absolute;
            right: 1em;
            top: 1em;
        }

        .skill-icon-home {
            font-size: 4em;
            color: white;
            margin-bottom: 10px;
            display: block;
            text-align: center;
        }

        .cta-button {
            display: inline-block;
            padding: 10px 20px;
            background-color: #ffa500;
            color: white;
            text-decoration: none;
            font-size: 1.2em;
            border-radius: 5px;
            margin: 0 auto;
            text-align: center;
        }

        /* Centering container for GitHub icon and button */
        .github-container {
            display: flex;
            flex-direction: column;
            justify-content: center;
            align-items: center;
            margin: 40px 0;
        }

        .cta-button:hover {
            background-color: #ff8c00;
        }

        @media (max-width: 768px) {
            nav ul {
                display: none;
                flex-direction: column;
                background-color: #333;
                position: absolute;
                width: 100%;
                left: 0;
                top: 50px;
                padding-bottom: 10px;
            }

            nav ul.show {
                display: flex;
            }

            .nav-toggle {
                display: block;
            }
        }

        /* Hero Section */
        .about {
            padding: 100px 20px;
            text-align: center;
            position: relative;
            overflow: hidden;
        }

        .about h1 {
            color: white;
            font-size: 4em;
            margin-bottom: 0.5em;
        }

        .about p {
            color: white;
            font-size: 1.5em;
        }

        .about::before {
            content: "";
            position: absolute;
            top: 0;
            left: 0;
            width: 100%;
            height: 100%;
            background: url('../resources/images/wallpaper.jpg') no-repeat center;
            background-size: cover;
            animation: zoom 20s infinite alternate;
            z-index: -1;
        }

        @keyframes zoom {
            0% {
                transform: scale(1);
            }
            100% {
                transform: scale(1.25);
            }
        }

        /* Image styling for responsiveness */
        img {
            max-width: 100%;
            height: auto;
            border-radius: 50%;
        }

        /* Portfolio Section */
        .portfolio {
            padding: 50px 20px;
            background-color: #f9f9f9;
            text-align: center;
        }

        .portfolio h2 {
            margin-bottom: 30px;
            font-size: 2em;
        }

        .portfolio-cards {
            display: flex;
            flex-wrap: wrap;
            justify-content: center;
            gap: 1%;
        }

        .project-card {
            display: block;
            width: 30%;
            padding: 20px;
            margin-bottom: 40px;
            border: 1px solid #ddd;
            border-radius: 10px;
            transition: transform 0.3s;
            background-color: white;
            box-shadow: 0 4px 8px rgba(0, 0, 0, 0.1);
            text-decoration: none;
            color: inherit;
            box-sizing: border-box;
        }

        .project-card:hover {
            transform: scale(1.05);
        }

        .project-card h3 {
            margin-bottom: 10px;
            color: #102e4a;
        }

        .project-card p {
            font-size: 1em;
            color: #777;
        }

        .coming-soon {
            color: indianred;
        }

        @media (max-width: 768px) {
            .project-card {
                width: calc(100% - 2em);
                margin: 1em 0;
            }

            .about h1 {
                font-size: 2.5em;
            }

            .about p {
                font-size: 1.2em;
            }
        }

        .text-to-type {
            color: #ffa500;
        }

        .cursor {
            font-size: 1em;
            color: #ffa500;
            animation: blink 1s linear infinite;
        }

        @keyframes blink {
            0% {
                opacity: 100%;
            }
            50% {
                opacity: 0%;
            }
        }

        @keyframes blink-less {
            0% {
                opacity: 100%;
            }
            50% {
                opacity: 30%;
            }
