<script>

    function sleep(ms) {
        return new Promise((resolve) => setTimeout(resolve, ms));
    }


    const textElement = document.querySelector(".text-to-type");
    const jobTitles = ["Software Developer", "Quality Engineer", "Cyber Security Professional"];
    let sleepTime = 35;

    const iterateJobTitles = async (element, textArray, textArrayIndex = 0) => {
        while (true) {
            let currentTitle = textArray[textArrayIndex];

            for (let i = 0; i < currentTitle.length; i++) {

                if (i === 0) {
                    element.textContent = "";

                }

                element.textContent += currentTitle[i];
                await sleep(sleepTime);

                if (i === currentTitle.length - 1) {
                    await sleep(2000);

                    for (let j = currentTitle.length - 1; j >= 0; j--) {
                        element.textContent = currentTitle.substring(0, j);
                        await sleep(sleepTime);
                    }
                    if (textArrayIndex === textArray.length - 1) {
                        textArrayIndex = 0;
                    } else {
                        textArrayIndex++;
                    }
                }
            }

        }

    };

    iterateJobTitles(textElement, jobTitles);

</script>

<script>
    const logoScroller = document.querySelector('.logos'),
        allIcons = logoScroller.querySelectorAll('.logo-slider'),
        arrowIcons = document.querySelectorAll('.icon i')

    let isDragging = false

    const handleIcons = scrollVal => {
        let maxScrollableWidth = logoScroller.scrollWidth - logoScroller.clientWidth
        arrowIcons[0].parentElement.style.display = scrollVal <= 0 ? 'none' : 'flex'
        arrowIcons[1].parentElement.style.display =
            maxScrollableWidth - scrollVal <= 1 ? 'none' : 'flex'
    }

    arrowIcons.forEach(icon => {
        icon.addEventListener('click', () => {
            // if clicked icon is left, reduce 350 from tabsBox scrollLeft else add
            let scrollWidth = (logoScroller.scrollLeft += icon.id === 'left' ? -340 : 340)
            handleIcons(scrollWidth)
        })
    })

    allIcons.forEach(tab => {
        tab.addEventListener('click', () => {
            logoScroller.querySelector('.active').classList.remove('active')
            tab.classList.add('active')
        })
    })

    const dragging = e => {
        if (!isDragging) return
        logoScroller.classList.add('dragging')
        logoScroller.scrollLeft -= e.movementX
        handleIcons(logoScroller.scrollLeft)
    }

    const dragStop = () => {
        isDragging = false
        logoScroller.classList.remove('dragging')
    }

    logoScroller.addEventListener('mousedown', () => (isDragging = true))
    logoScroller.addEventListener('mousemove', dragging)
    document.addEventListener('mouseup', dragStop)
</script>

